/** @tossdocs-ignore */
function minBy(collection, iteratee) {
  if (collection.length === 0) {
    return undefined;
  }

  return collection.reduce(function (a, b) {
    return iteratee(a) <= iteratee(b) ? a : b;
  }, {});
}

export { minBy };
